                    //                     <br></br>
                    //                 </div>
                    //             </div>
                    //         )
                    //     } 
                    // }else{
                        return(
                            <div className="personBox noEvents" id={data[2]} key={index} hidden={data[2] === team || team === "alle" ? false : true}>
                                <div>
                                    <p className="list-group-event">{data[1]}</p>
                                    <p>Ingen møder i dag!</p>
                                    <p>{data[2]}</p>
                                    <br></br>
                                </div>
                            </div>
                        )
                    }
                }
                
             })}
             </div>
     </div>
     )
}
